import React, { Component } from 'react'
import Listitem from './Listem'

export default class List extends Component {
  render() {
    return (
      <div className="row">
        {
          this.props.users.items.map((a) => {

            return <Listitem key={a.item.id} users={this.pros.users} />

          })

        }
      </div>
    )
  }
}
